	public static String readTextFromFileWithSpaceSeparator(String filePath) throws IOException {
		StringBuffer sb = new StringBuffer();
		BufferedReader br = null;
		File file = new File(filePath);
		if (!file.exists())
			return "";
		try {
			br = new BufferedReader(new FileReader(filePath));
			String line;
			@SuppressWarnings("unused")
			long lineNo = 0;
			while ((line = br.readLine()) != null) {
				lineNo++;
				// space added after line+ b/c of conjoined words occuring -
				// e.g., ofrecord. OLD: sb.append(line + " ");
				sb.append(line).append(" ");
				sb.append(LineSeparator);
			}
		} finally {
			if (br != null)
				try {
					br.close();
				} catch (Exception e) {
				}
		}
		// System.out.println("html: " + sb.toString());
		return sb.toString();
	}

