	public static void writeTextToFile(File fn, String text)
			throws FileNotFoundException, UnsupportedEncodingException {
		PrintWriter pw = null;
		try {
			pw = new PrintWriter(fn, "UTF8");
//			System.out.println("writeTextToFile txt="+text);
			pw.append(text);
		} finally {
			if (pw != null)
				try {
					pw.close();
				} catch (Exception e) {
//					System.out.println("exception e");
				}
		}
		pw.close();
	}

