	public static void loadIntoMysql3(String filename, String table, String fieldTermination, String lineTermination,
			String database) throws SQLException, FileNotFoundException {
		// for \r\n -- line termination - it must be \\r\\n
		File file = new File(filename);
		long size = file.length();
		// System.out.println("loadFileIntoMysql fileSize:: " + size);
		String query = "LOAD Data INFILE '" + filename + "' ignore INTO TABLE " + table + " FIELDS TERMINATED BY '"
				+ fieldTermination + "' lines terminated by '" + lineTermination + "';";
		if (size > 0)
			MysqlConnUtils.executeQueryDB(query, database);

	}

	public static void loadMasterIndexIntoMysql(String filename, String table) throws FileNotFoundException {

		File file = new File(filename);
		long size = file.length();
		// System.out.println("loadFileIntoMysql fileSize:: " + size);

		String query = "LOAD Data INFILE '" + filename + "' ignore INTO TABLE " + table + " FIELDS TERMINATED BY '|' "
				+ " LINES TERMINATED BY '\\n' IGNORE 10 LINES;";
		// System.out.println("mysql query::" + query);

		try {
			if (size > 0)
				MysqlConnUtils.executeQuery(query);
		} catch (SQLException e) {
			e.printStackTrace(System.out);
		}
	}

	public static boolean deleteDirectory(File directory) {
		if (directory.exists()) {
			File[] files = directory.listFiles();
			if (null != files) {
				for (int i = 0; i < files.length; i++) {
					if (files[i].isDirectory()) {
						deleteDirectory(files[i]);
					} else {
						files[i].delete();
					}
				}
			}
		}
		return (directory.delete());
	}

	public static void tempMoveFile(String folderFilesAreIn, String folderToMoveTo, int yr)
			throws NumberFormatException, IOException {

		Utils.createFoldersIfReqd(folderToMoveTo);

		NLP nlp = new NLP();

		File folder = new File(folderFilesAreIn);
		File[] listOfFiles = folder.listFiles();
		File f = new File("");
		for (int i = 0; i < listOfFiles.length; i++) {
			f = listOfFiles[i];
			System.out.println("rename file?=" + f.getName());
			if (nlp.getAllMatchedGroups(f.getName(), Pattern.compile("[12]{1}[09]{1}[0-9]{2}")).size() < 1)
				continue;

			if (Integer.parseInt(f.getName().substring(0, 4)) != yr)
				continue;

			System.out.println("file move to=" + folderToMoveTo + f.getName());
			listOfFiles[i].renameTo(new File(folderToMoveTo + f.getName()));
		}
	}

